import React from 'react';


function Hangman() {
    window.addEventListener("load", () => {
        const canvas = document.querySelector('#canvas');
        const ctx = canvas.getContext('2d');
        ctx.lineWidth = 3;
        ctx.strokeStyle = '#003300';
        firstMark(ctx);
        secondMark(ctx);
        thirdMark(ctx);
        fourthMark(ctx);
        fifthMark(ctx);

        ctx.moveTo(60,70);
        ctx.lineTo(60,100);
        ctx.stroke();
    })

    return (
    <div className="App">
        <canvas id="canvas"></canvas>
    </div>
    );
}

function firstMark(ctx) {
    ctx.moveTo(10,130);
    ctx.lineTo(40,130);
    ctx.stroke();
}

function secondMark(ctx) {
    ctx.moveTo(25,40);
    ctx.lineTo(25,130);
    ctx.stroke();
}

function thirdMark(ctx) {
     ctx.moveTo(25,40);
     ctx.lineTo(60,40);
     ctx.stroke();
}

function fourthMark(ctx) {
    ctx.moveTo(60,40);
    ctx.lineTo(60,50);
    ctx.stroke();
}

function fifthMark(ctx) {
    let centerX = 60;
    let centerY = 60;
    let radius = 10;
    ctx.beginPath();
    ctx.arc(centerX, centerY, radius, 0, 2 * Math.PI, false);
    ctx.stroke();
}



export default Hangman;
